class ResBlockFC(nn.Module):
    def __init__(self, in_dim: int, out_dim: int, act: nn.Module = nn.ReLU(True)):
        super(ResBlockFC, self).__init__()
        self.residual_layers = nn.Sequential(
            nn.Linear(in_dim, out_dim, bias=True),
            act,
            nn.Linear(out_dim, out_dim, bias=True),
        )
        self.short_cut = nn.Linear(in_dim, out_dim, bias=True) if in_dim != out_dim else nn.Identity()
        self.act = act

    def forward(self, x):
        y = self.residual_layers(x)
        z = self.short_cut(x)
        return self.act(y + z)


class AERes(nn.Module):
    def __init__(self, ndfs, ngfs, embed_dim):
        super(AERes, self).__init__()
        ndf4, ndf3, ndf2, ndf1 = ndfs
        ngf4, ngf3, ngf2, ngf1 = ngfs
        self.encoder = nn.Sequential(
            ResBlockFC(74, ndf1, nn.LeakyReLU(0.2, True)),
            ResBlockFC(ndf1, ndf2, nn.LeakyReLU(0.2, True)),
            ResBlockFC(ndf2, ndf3, nn.LeakyReLU(0.2, True)),
            ResBlockFC(ndf3, ndf4, nn.LeakyReLU(0.2, True)),
            ResBlockFC(ndf4, embed_dim, nn.LeakyReLU(0.2, True)),
        )
        self.decoder = nn.Sequential(
            ResBlockFC(embed_dim, ngf4, nn.LeakyReLU(0.2, True)),
            ResBlockFC(ngf4, ngf3, nn.LeakyReLU(0.2, True)),
            ResBlockFC(ngf3, ngf2, nn.LeakyReLU(0.2, True)),
            ResBlockFC(ngf2, ngf1, nn.LeakyReLU(0.2, True)),
            ResBlockFC(ngf1, 74, nn.LeakyReLU(0.2, True)),
        )

    def forward(self, x):
        z = self.encoder(x)
        y = self.decoder(z)
        return y


